import { useRef, useState } from "react";

const ManageEditor = () => {
    const [food, setFood] = useState("sss");
    
    return(
        <div className="ManageEditor">
            <form>
                <h2>오늘의 식단</h2>
                <div>
                    <select value={food}>{food}ss</select>
                    <input value={food}></input>
                </div>
            </form>
        </div>
    );
}

export default ManageEditor;
